import { useEffect, useState } from "react";
import axios from "axios";

export default function App() {
  const [cardList, setCardList] = useState([]);

  useEffect(() => {
    const fetchData = () => {
      console.log("here");
      axios.get("https://dummyjson.com/recipes?limit=10&skip=10&select=name,image")
        .then((response) => {
          console.log("response", response.data);
          setCardList(response.data.recipes);
        })
        .catch((error) => {
          console.log("error", error);
        });
    };
    console.log("herehfhfhf");
    fetchData();
  }, []);

  return (
    <div className="App">
      <div style={{ display: "flex", flexDirection: "row", flexWrap: "wrap" }}>
        {cardList.length > 0 &&
          cardList.map((item) => {
            return (
              <div
                style={{
                  width: "400px",
                  height: "400px",
                  border: "black 2px solid",
                }}
              >
                <img
                src={item.image}
                height={400}
                width={400}
                alt="imgae"
                />
                <span>{item.name}</span>
              </div>
            );
          })}
      </div>
    </div>
  );
}
